style.css:
@-moz-document url-prefix("http://"), url-prefix("https://") {
body, html {
        filter: grayscale(100%) !important;
        background-color: #bfbfbf !important; /* Optional: change to your preferred gray */
    }
    * {
        background-color: inherit !important;
        color: #333 !important; /* Optional: change to your preferred text color */
    }
}
